import math
# Without Bitwise
def repeatedNumber(A):
        sum_=0
        sum_sq=0
        for i in range(0,len(A)):
            sum_+=(A[i]-(i+1))
            sum_sq+=(A[i]*A[i]-(i+1)*(i+1))
        repeat= (sum_sq/sum_+sum_)/2
        missing=repeat-sum_
        
        return [int(repeat),int(missing)]
# Using Bitwise
def repeatedNumber_bit(A):
        xor_n=0
        for i in range(len(A)):
            xor_n^=A[i]^(i+1)
        set_bit=0
        print(xor_n)
        print(math.log(256,2))
        for i in range(int(math.log(xor_n,2)+1)):
            if xor_n>>i&1==1:
                set_bit=i
                break
        
        print(set_bit)
        num1=0
        num2=0
        for i in range(len(A)):
            if A[i]>>set_bit&1==0:
                num1^=A[i]
            else:
                num2^=A[i]
            
            if i+1>>set_bit&1==0:
                num1^=(i+1)
            else:
                num2^=(i+1)
        
        for i in range(len(A)):
            if num1==A[i]:
                return [num1,num2]
        
        return [num2,num1]
